import React from "react";


const TextInput = ({ label, placeHolder, textType }) => {
  return (
    <div className="form-group">
      {label && <label>{label}</label>}
      <input className="form-control" type={textType} placeholder={placeHolder} />
    </div>
  );
};
export default TextInput;
